import React from 'react'
import { Modal, Header, Icon } from 'semantic-ui-react';

class CreatePostModal extends React.Component{
    render(){
        return(
            <Modal open={true} >
                <Modal.Header >
                    <Header as='h2'><Icon name='write'/>Tạo Bài Viết</Header>
                </Modal.Header>
            </Modal>
        );
    }
}

export default CreatePostModal
